import React, { Component } from 'react';
import './App.css'
import Header from './components/Header';
import Timer from './components/Timer';


export default class App extends Component {

  render() {
    return (
      <div>
        <Header />
        <Timer />
        <button>ESCONDER TIMER</button>
      </div>
    )
  }
}
